// Transparent header
var topmenu_height = 0;
if($('.header-menu-bg').length > 0) {
	topmenu_height = $('.header-menu-bg').height();
}

if($(window).width() > 1024) {
	if($('body.transparent-header').length > 0) {
		$('header').addClass('transparent-header');
		$('.header-menu-bg').addClass('transparent-header');

		if($("#wpadminbar").length > 0) {
			wp_adminbar_height = $("#wpadminbar").height();
		} else {
			wp_adminbar_height = 0;
		}
		
		$("header.transparent-header").css("top", wp_adminbar_height + topmenu_height);
	}
}
// Sticky header
function thebuilt_stickyHeaderWorker() {

	// Transparent Header
	if($('body.transparent-header').length > 0) {

		var transparentscrolloffset = 60; // when we will disable transparency

		if(isTouchDevice()==false) {

			var scrolltop = $(document).scrollTop();
		
			if(scrolltop > transparentscrolloffset) {


				if(header_fixed == 0) {

					header_fixed = 1;

					$("header.sticky-header").addClass('fixed');
					$('header').removeClass('transparent-header');
					$('.header-menu-bg').removeClass('transparent-header');

					$("header.sticky-header .col-md-12").css("height", 50);
					
					$("header.sticky-header").css("top", wp_adminbar_height);
					
				}

			} else {

				if(header_fixed == 1) {
					
						$("header.sticky-header").removeClass('fixed');
						$('header').addClass('transparent-header');
						$('.header-menu-bg').addClass('transparent-header');
						$("header.sticky-header .col-md-12").css("height", header_original_height);

						$("header.transparent-header").css("top", wp_adminbar_height + topmenu_height);

						header_fixed = 0;

				}
				
			}

		} 
	} else {
		// Regular header
		if(isTouchDevice()==false) {

			var scrolltop = $(document).scrollTop();
		
			if((scrolltop > ($(window).height()/2))) {

				if((header_hided == 1) && (header_fixed = 1)) {
					header_fixed = 0;
				}

				if(header_fixed == 0) {

					header_fixed = 1;

					$("header.sticky-header").addClass('fixed');

					$("header.sticky-header .col-md-12").css("height", 50);

					$("header.sticky-header").css("top", -50 + wp_adminbar_height);
					
					$("header.sticky-header").css("top", wp_adminbar_height);
						
					if($("header.sticky-header .mainmenu-belowheader").length > 0) {

						$("body").css("padding-top", header_original_height+$("header.sticky-header .mainmenu-belowheader").height());
					} else {
						$("body").css("padding-top", header_original_height);
					}

				}

			} else {

				if(header_fixed == 1) {

					$("header.sticky-header").css("top", -90 - wp_adminbar_height);

					header_hided = 1;

					if((scrolltop < ($(window).height()/2) -100)) {

						$("header.sticky-header").removeClass('fixed');
						$("body").css("padding-top", 0);
						$("header.sticky-header .col-md-12").css("height", header_original_height);

						header_fixed = 0;
						header_hided = 0;

					}
				}
				
			}

		} 
	}
}

if($("header.sticky-header").length > 0) {
	if($(window).width() > 1024) {

		// Transparent Header
		if($('body.transparent-header').length > 0) {
			var header_fixed = 0;
			var header_original_height = 100;//$("header.sticky-header .col-md-12").height();
			$("header.sticky-header .col-md-12").height(100);

			var header_menu_bg_original_height= 0;
			
			var wp_adminbar_height = 0;
			var header_hided = 0;

			if($("#wpadminbar").length > 0) {
				wp_adminbar_height = $("#wpadminbar").height();
			}

			$("header.sticky-header").css("top", wp_adminbar_height + topmenu_height);

			// Run first time
			
			thebuilt_stickyHeaderWorker();

		} else {
		// Regular header
			var header_fixed = 0;
			var header_original_height = $("header.sticky-header .col-md-12").height();
			var header_menu_bg_original_height= 0;
			var header_mainmenu_belowheader_height = 0;
			var wp_adminbar_height = 0;
			var header_hided = 0;

			if($("header.sticky-header .mainmenu-belowheader").length > 0) {
				header_mainmenu_belowheader_height = $("header.sticky-header .mainmenu-belowheader").height();
			} else {
				header_mainmenu_belowheader_height = 0;
			}

			if($("#wpadminbar").length > 0) {
				wp_adminbar_height = $("#wpadminbar").height();
			}

			$("header.sticky-header").css("top", -90 - wp_adminbar_height);

			// Run first time
			
			thebuilt_stickyHeaderWorker();	
			
		}

		// Run on scroll
		$(window).scroll(function () {
			
			thebuilt_stickyHeaderWorker();
			
		});

	}

}

